import React from "react";
import avatar from "../assets/profile.png";
import {Link} from "react-router-dom"
import {useFormik} from 'formik';
import {Toaster} from 'react-hot-toast';




export default function Username() {

  const formik=useFormik({
       initialValues:
       {
         username:''
       }, 

  })

  return (
    <div>
      <div className="row justify-content-center">
        <h3 className="col-2 ">Hello Again</h3>
      </div>
      <div className="row justify-content-center">
        <p className="col-2.5">Explore more by connecting with us</p>
      </div>

      <div className="row justify-content-center ">
      <div class="col-md-2-sm-1  px-0">
        <img style={{height:200}}
          className="img-responsive "
          src={avatar}
          alt="proile"
        ></img>
        </div>

      </div>
      <div className="row justify-content-center ">
          <input className="text" style={{marginTop:10}}type="text" name="username" placeholder="Username" ></input>

        </div>
        <div  className="row justify-content-center  ">
          <button  style={{marginTop:10}} className="btn btn-success">Let's go</button>
        </div>
        <div className="row justify-content-center  ">
          <p>Not a member? <Link to="/register">Register now</Link></p>
        </div>
    </div>
  );
}
